import React from 'react'
import styled from 'styled-components'


const Styles = styled.div`

    .container {
        width: 100%;
        height: 100%;
        background-color: #A9BCD0;
    }

    .content {
        position: relative;
        top: 0;
        left: 0;
        bottom:0;
        right:0;
      }
    
    .title {
        color: white;
        font-family: Verdana, Arial, Helvetica, sans-serif;
        text-align: center;
        font-Size: 35px;
        letter-spacing: 3px;
    }

    .logo {
        height: 25px;
        width: 25px;
    }
`;

const ExperiencesPage = () => {
    return (
        <Styles>
            <div className="container">
                <div className="content">
                    <p className="title">EXPERIENCES</p>
                    <ul id="experiencesList">
                        <li>Software Developer Intern</li>
                        <li>Data Management Intern</li>
                        <a href="https://www.vectorsolutions.com/"><img src="../../assets/vectorsolutions.jpg" className="logo" title="Vector Solutions Logo" alt="vslogo"/></a>
                        <a href="https://www.intel.com/content/www/us/en/homepage.html"><img src="../../assets/intel.jpg" className="logo" title="Intel Logo" alt="iLogo"/></a>
                    </ul>
                </div>
            </div>
        </Styles>
    )
}

export default ExperiencesPage
